      <BrowserRouter>
        <Routes>
        <Route path="/" element={<users/>}/>
        <Route path="/add" element={<add/>}/>
        <Route path="/update" element={<update/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
